import axios from 'axios'


const baseURL = ""

const getAll = () => {
    const request = axios.get(baseURL)
    return request.then(response => response.data)
}

const createNote = (newNote) => {
    const request = axios.post(baseURL, newNote)
    return request.then(response => response.data)
}
